 case, you both will only receive one of each item and the rest will be given away.<\/p><p>Try to get as many items as you can. <\/p><p>Here are the icons representing the objects:<\/p><p>Medicine: <img src="http://emotions.usc.edu/group/images/Pills-MD.png" alt="Medicine" width="42" height="42" /><\/p><p>Water Bottles: <img src="http://emotions.usc.edu/group/images/Waterbottle-MD.png" alt="Water Bottles" width="42" height="42" /><\/p><p>Money: <img src="http://emotions.usc.edu/group/images/CashPic-MD.png" alt="Money" width="42" height="42" /><\/p><p>Food Cans: <img src="http://emotions.usc.edu/group/images/can-new.png" alt="Food Cans" width="42" height="42" /><\/p>',Uld='<pre>',C4c='<span',$8c="<span style='color:",kbd='=',Sld='==========\n',Lld='============\n',Nld='========================================================\n',kBd='=P',F4c='>',QZc='?',nPc='@',b3c='A request timeout has expired after ',W4c='A-Za-z\xC0-\xD6\xD8-\xF6\xF8-\u02B8\u0300-\u0590\u0800-\u1FFF\u2C00-\uFB1C\uFDFE-\uFE6F\uFEFD-\uFFFF',D0c='ABSOLUTE',l9c='ALL',lZc='ALPHABETIC',dGd='ANNOTATION_TYPE',V_c='AUTO',ISd='AbsolutePanel',PWc='AbsolutePanel.java:',kLd='AbsolutePositionDropController',lLd='AbsolutePositionDropController$Draggable',NXc='AbsolutePositionDropController.java:',SLd='AbstractActivity',sLd='AbstractArea',vSc='AbstractArea.java:',BLd='AbstractCollection',aQc='AbstractCollection.java:',yLd='AbstractDragController',rPc='AbstractDragController.java:',iLd='AbstractDropController',JXc='AbstractDropController.java:',TZd='AbstractHashMap',VZd='AbstractHashMap$EntrySet',WZd='AbstractHashMap$EntrySetIterator',YZd='AbstractHashMap$MapEntryNull',ZZd='AbstractHashMap$MapEntryString',ted='AbstractHashMap.java:',CLd='AbstractList',$Zd='AbstractList$IteratorImpl',_Zd='AbstractList$ListIteratorImpl',vPc='AbstractList.java:',tLd='AbstractLocation',iYc='AbstractLocation.java:',SZd='AbstractMap',a$d='AbstractMap$1',b$d='AbstractMap$1$1',c$d='AbstractMap$2',d$d='AbstractMap$2$1',jQc='AbstractMap.java
